  false,\n\t\"url\": null,\n\t\"notes\": \"Shorelines were derived from a U.S. Geological
  Survey topographic lidar survey that was conducted on July 12-14, 2013 over Dauphin
  Island, Alabama and Chandeleur, Stake, Grand Gosier and Breton Islands, Louisiana
  and published in USGS Data Series 838. Photo Science, Inc., was contracted by the
  USGS to collect and process these data. Lidar data were acquired around portions
  of both the Alabama and Louisiana barrier islands; however, this dataset only contains
  shorelines created from data acquired from Breton Island, Louisiana. Shorelines
  were vectorized in ArcMap 10.2.2 so they could be used for area and shoreline change
  analysis, using the Digital Shoreline Analysis System (DSAS) version 4.0.\",\n\t\"license_title\":
